import React from 'react';
import Timeline from '@material-ui/lab/Timeline';
import TimelineItem from '@material-ui/lab/TimelineItem';
import TimelineSeparator from '@material-ui/lab/TimelineSeparator';
import TimelineConnector from '@material-ui/lab/TimelineConnector';
import TimelineContent from '@material-ui/lab/TimelineContent';
import TimelineDot from '@material-ui/lab/TimelineDot';
import "./Timeline.css"
import { Typography } from '@material-ui/core';
import WorkIcon from '@material-ui/icons/Work';
import FacebookIcon from '@material-ui/icons/Facebook';
import GitHubIcon from '@material-ui/icons/GitHub';
import LinkedInIcon from '@material-ui/icons/LinkedIn';


const customTimeline = ({title, children}) => {
    return (
        <Timeline className={"timeline"}>
          
          <TimelineItem className={"timeline_first_item"}>
            <TimelineSeparator>
              <TimelineDot className={"timeline_dot_header"}><WorkIcon/></TimelineDot> 
              <TimelineConnector />
            </TimelineSeparator>
            <TimelineContent><Typography variant="h6" className={"timeline_header"}>Title{title}</Typography></TimelineContent>
          </TimelineItem>

          <TimelineItem>
            <customTimelineSeparator/>
            <TimelineContent>
              <div className={"timeline_button"}>
              <button>
              <TimelineDot className={"timeline_dot"}/>
              GitHub
              </button>
              </div>
            </TimelineContent>
          </TimelineItem>

          <TimelineItem>
            <customTimelineSeparator/>
            <TimelineContent>
              <div>

            <TimelineDot className={"timeline_dot"}/>
                LinkedIn
              </div>
            </TimelineContent>
          </TimelineItem>

          <TimelineItem>
            <customTimelineSeparator/>
            <TimelineContent>
              <div>
                
              <TimelineDot className={"timeline_dot"}/> 
              <button> Facebook </button>
              </div>
            </TimelineContent>
          </TimelineItem>
        </Timeline>
    );
};

export default customTimeline;
